  false,\n\t\"url\": null,\n\t\"notes\": \"From July through September of 2004 we
  used a combination of drift fence, pitfall and funnel traps, in addition to coverboards,
  active search methods and opportunistic visual searching on the Refuge to document
  the presence or absence of 22 potential species native to northeastern Nevada. We
  surveyed within the nine major Refuge habitat types outlined under u201chabitat
  codesu201d in the Refuge Wildlife Checklist: 1) marsh, open water areas, 2) riparian
  areas, 3) meadows, grasslands, 4) shrub-steppe, 5) wooded areas, 6) canyons, 7)
  rocky areas, cliffs, caves, 8) montane and 9) buildings, residential areas. The
  objective of this survey was to capture or observe every species of herpetofauna
  present on the Refuge. Results from this survey will be used to compile a herpetofauna
  species list for inclusion in the Refuge Wildlife Checklist brochure, and are considered
  baseline information of Refuge herpetofauna.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
